import React from "react";
import Header from "../Header";
import "./App.css";
import ItemList from "../ItemList";
import PersonDetails from "../PersonDetails";
import RandomPlanet from '../RandomPlanet';

const App = () => {
  return (
    <div>
      <Header />
      <div>
          <RandomPlanet />
        <ItemList />
        <PersonDetails />
      </div>
    </div>
  );
};

export default App;
